import React, { Fragment } from 'react';

import Buds from './Components/Buds/Buds';
import Cart from './Components/Cart/Cart';
import Header from './Components/Layout/Header';

function App() {
  return (
    <Fragment>
      <Cart />
      <Header />
      <main>
        <Buds />
      </main>
    </Fragment>
  );
}

export default App;
